import React, { Component } from "react";

export default class DishDetail extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-12 col-md-5 m-1">

        </div>
        <div className="col-12 col-md-5 m-1">
          <h3>Comment</h3>
          <ul className="list-unstyled">
            {dish.comments.map(item => {
              return (
                <React.Fragment>
                  <li>
                    <p>{item.comment}</p>
                  </li>
                  <li>
                    <p>
                      {"--" +
                        item.author +
                        " , " +
                        moment(item.date).format("MMM DD, YYYY")}
                    </p>
                  </li>
                </React.Fragment>
              );
            })}
          </ul>
        </div>
      </div>
    );
  }
}
